const replaceAllFs = (arr) => {
    let result = [];
    for(let i=0;i<arr.length;i++){
        if(arr[i]==='a'){
            result.push('a');
        }else{
            if(!result[result.length-1]){
                result.push('b');
            }else{
                if(result[result.length-1] === 'b'){
                    result.pop();
                    result.push('h');
                }else{
                    result.push('h');
                }
            }
        }
    }
    return result;
}

